import React from 'react'
import Navbar from '../Components/Navbar/Navbar'
import "./home.scss"

const Home = () => {
  return (
    <div className='home'>

     <Navbar/>
     <img height={800} src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ8OxcVbJXK6YZhNfih-n-xgjdKqbSustvi374P148mKzxqq07J3UbGx9gxvfNDjhQcRhU&usqp=CAU" alt="" />
    </div>
  )
}

export default Home
